import React from "react";
import { Box, Typography } from "@mui/material";
import "./style/Articles.css";

type ArticleProps = {
  name: string;
  link: string;
  description: string;
};

function Articles(props: ArticleProps) {
  return (
    <Box className="article-box">
      <Typography className="article-name" fontWeight={"fontWeightBold"}>
        {props.name}
      </Typography>
      <Typography className="article-link">{props.link}</Typography>
      <Typography className="article-description">
        {props.description}
      </Typography>
    </Box>
  );
}

export default Articles;
